import React from 'react';
import Container from '../components/Container';

export default function Header() {
    return (
        <Container>
            <div className="">
                <div className="entrance neonText">
                    Hey, I'm Michael.<br />
                    I like dogs.
                </div>
                <span className="float-right float-sm-none"><img src="./images/self.png" alt="self portrait" height="300rem" width="300rem" />
                </span>
            </div>

        </Container>
    )
}
